import React from "react";
import Button from "./Button";

const ButtonsList = () => {
  return (
    <div className="flex">
      <Button name="All" />
      <Button name="One" />
      <Button name="Two" />
      <Button name="Three" />
      <Button name="Four" />
      <Button name="Five" />
      <Button name="Six" />
      <Button name="Seven" />
    </div>
  );
};

export default ButtonsList;
